import React, { useState } from 'react';
import { Home, Briefcase, User, LogIn, LogOut, Menu, X } from 'lucide-react';

const Navbar = ({ currentView, onViewChange }) => {
  const [showUserMenu, setShowUserMenu] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  
  // For now, we'll simulate no user logged in
  const isAuthenticated = false;
  const user = null;

  return (
    <header className="bg-white/80 backdrop-blur-2xl shadow-xl border-b border-gray-200/50 sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-6">
        <div className="flex items-center justify-between h-20">
          {/* Logo */}
          <div className="flex items-center space-x-3 cursor-pointer" onClick={() => onViewChange('home')}>
            <div className="w-12 h-12 bg-gradient-to-r from-blue-600 via-purple-600 to-indigo-600 rounded-xl flex items-center justify-center text-white font-bold text-xl shadow-lg">
              S
            </div>
            <div>
              <h1 className="text-2xl font-bold bg-gradient-to-r from-blue-600 via-purple-600 to-indigo-600 bg-clip-text text-transparent">
                StartupHub
              </h1>
              <p className="text-xs text-gray-500">Discover Innovation</p>
            </div>
          </div>

          {/* Desktop Navigation */}
          <nav className="hidden md:flex items-center space-x-1">
            <button
              onClick={() => onViewChange('home')}
              className={`flex items-center space-x-2 px-4 py-2 rounded-xl font-semibold transition-all duration-300 ${
                currentView === 'home' 
                  ? 'bg-blue-100 text-blue-600 shadow-md' 
                  : 'text-gray-600 hover:text-blue-600 hover:bg-blue-50'
              }`}
            >
              <Home className="w-4 h-4" />
              <span>Startups</span>
            </button>
            <button
              onClick={() => onViewChange('jobs')}
              className={`flex items-center space-x-2 px-4 py-2 rounded-xl font-semibold transition-all duration-300 ${
                currentView === 'jobs' 
                  ? 'bg-green-100 text-green-600 shadow-md' 
                  : 'text-gray-600 hover:text-green-600 hover:bg-green-50'
              }`}
            >
              <Briefcase className="w-4 h-4" />
              <span>Jobs</span>
            </button>
            {isAuthenticated && (
              <button
                onClick={() => onViewChange('profile')}
                className={`flex items-center space-x-2 px-4 py-2 rounded-xl font-semibold transition-all duration-300 ${
                  currentView === 'profile' 
                    ? 'bg-purple-100 text-purple-600 shadow-md' 
                    : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                }`}
              >
                <User className="w-4 h-4" />
                <span>Profile</span>
              </button>
            )}
          </nav>

          {/* Right Side */}
          <div className="flex items-center space-x-3">
            {isAuthenticated ? (
              <div className="relative">
                <button
                  onClick={() => setShowUserMenu(!showUserMenu)}
                  className="flex items-center space-x-3 p-2 hover:bg-gray-50 rounded-xl transition-all"
                >
                  <div className="w-10 h-10 bg-gradient-to-r from-blue-500 to-purple-600 rounded-full flex items-center justify-center text-white font-bold text-sm">
                    U
                  </div>
                  <div className="hidden md:block text-left">
                    <div className="text-sm font-semibold text-gray-800">User Name</div>
                    <div className="text-xs text-gray-500">Premium Member</div>
                  </div>
                </button>
              </div>
            ) : (
              <button
                onClick={() => onViewChange('auth')}
                className="flex items-center space-x-2 bg-gradient-to-r from-blue-500 to-purple-600 text-white px-6 py-3 rounded-xl hover:from-blue-600 hover:to-purple-700 transition-all transform hover:scale-105 shadow-lg"
              >
                <LogIn className="w-4 h-4" />
                <span>Sign In</span>
              </button>
            )}
          </div>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
